import React from 'react';
import Tabs from 'react-bootstrap/Tabs';

export default class Main extends React.Component {
    constructor(props, context) {
        super(props, context);
        this.state = {
            long: null,
            lat: null,
            key: 'home'
        }
    }

//  componentDidMount() {
